export default[{
    path: '/web',
    name: 'web',
    component: resolve => require(["@/views/web/index.vue"], resolve),
    children:[
        {
            //基本管理列表
            path:'/web/private_policy',
            name:'private_policy',
            component: resolve => require(['@/views/web/private_policy.vue'],resolve),
            meta:{
                title:'隐私政策',
            }
        }
        ]
}]
